import React from 'react';

function Ticker() {
    return (
        <div class="hwrap"><div class="hmove">
            <div class="hitem">art for systems development.</div>
            <div class="hitem">music for preservation + cultivation + experimentation.</div>
            <div class="hitem">programming for material function.</div>
            <div class="hitem">literature for documentation + expression.</div>
            <div class="hitem">interdisciplinary practice for world building.</div>
            <div class="hitem">*** FORUM CACHE ***</div>
        </div></div>
    )
}

export default Ticker;
